properties.description:
Nella rinomata zona Porta Genova/Darsena PIA-RE propone in vendita, al secondo piano con ascensore di un palazzo d'epoca degli inizi '900 e con servizio di portineria per l'intera giornata, questo grazioso appartamento con terrazzino indipendente.Recentemente ristrutturato l'appartamento si presenta in ottime condizioni manutentive ed è pronto ad essere abitato ed è cosi composto :
- accesso dal terrazzino indipendente;
- zona giorno ampia e con cucina a vista;
- bagno completo di servizi igienici e vano doccia;
- accogliente camera da letto matrimoniale;
- un comodo ripostiglio.L'appartamento viene venduto arredato ed accessoriato di tutti gli elettrodomestici.Per maggiori info inviateci una email
